using Decimals
using Test
using Decimals: @with_context

@testset "sqrt" begin
@with_context (Emax = 384, Emin = -383, precision = 9, rounding = RoundingMode{:NearestTiesAway}()) @test(sqrt(dec"1") == dec"1")
